txtDescription:
	 Сохрани свежесть своей обуви вместе с капсулами Pills.


	 Впитывают влагу;
	 Убивают бактерии;
	 Устраняют неприятный запах;
	 Освежающий эффект длится более 90 дней.


Инструкция:
	 ШАГ 1: Поверни капсулу для активации
	 ШАГ 2: Помести каждую, внутрь своего кроссовка
	 ШАГ 3: Оставь на несколько часов, пока запах полностью не исчезнет
	 ШАГ 4: Закрути капсулу обратно для сохранения ее свойств
